<?phpnamespace DGIModule\Controller\Factories;use DGIModule\Controller\DashboardController;use Zend\ServiceManager\FactoryInterface;use Zend\ServiceManager\ServiceLocatorInterface;class DashboardControllerFactory implements FactoryInterface{    /**     * @param ServiceLocatorInterface $serviceLocator     * @return DashboardController     */    public function createService(ServiceLocatorInterface $serviceLocator)    {        $sl = $serviceLocator->getServicelocator();        return new DashboardController(            $sl->get('Config'),            $sl->get('doctrine.entitymanager.orm_default'));    }	}